import React from "react";
import Contacts from "./Contacts";
import BackButton from "./BackButton";

function About() {
    return (
        <div>
            <BackButton />

            {/* color #78b0a0 */}
            <h1>Who am I?</h1>

            <p>I'm an Electrical and Computer engineer who is
                passionate about technology, and other problem solving
                fields. Additionally, I love facing new challenges</p>
            <Contacts />
        </div>
    );
}

export default About;
